import React from 'react';
import { Router } from '@reach/router';
import Pokemon from './components/FetchPokemon'
import PokemonAx from './components/AxiosPokemon'


function App() {
  return (
    <div>
    <Router>
    <PokemonAx path="/route-axios" />
    <Pokemon />
    </Router>
    </div>
  );
}

export default App;
